import React,{useState,useEffect} from 'react';

// import RemoteDataGrid from "./components/CompoRegCli.js";
import Contenedor,{Alert} from '../componentsPrincipales/Alert.jsx'
import {Button} from 'primereact/button';
import Tickets from '../moduloTickets/components/tools.js'

class pruebaTT extends React.Component {
  constructor(props) {
    super(props);
    this.state={
      qr: '',
      dataQR: '',
      folio: '',
      total: '',
      fecha: '',
      hora: '',
      medicamentos: [],
      servicios: [],
      displayBasic: false
    }
  }

  componentDidMount() {

  }


  onClick=(name,position) => {
    let state={
      [`${name}`]: true
    }

    if(position) {
      state={
        ...state,
        position
      }
    }
    this.setState(state);
  }

  onHide=(name) => {
    this.setState({
      [`${name}`]: false
    });
  }

  render() {
    return (
      <React.Fragment>
        <Contenedor />

        <Tickets tipo="0" idCita='54' />tipo 0

        <Tickets tipo="1" idCita='54' />tipo 1
      </React.Fragment>
    );
  }
}

export default pruebaTT;
